import styled from "styled-components";

export const Button = styled.button`
  width: 100%;
  height: 32px;
  margin: 16px 0px;
  color: #d9e3f0;
  background-color: #4caf50;
  border: none;
  border-radius: 8px;
  box-shadow:  -4px 12px 59px -3px rgba(138,131,138,1);
  align-self: flex-end;
`;
